var localCache=function(){var LocalCache=function(){};var expires_key="_expires",cache_key_prefix="cached-";LocalCache.prototype.setItem=function(key,value,expires){localStorage.setItem(cache_key_prefix+key,JSON.stringify(value));if(expires){localStorage.setItem(cache_key_prefix+key+expires_key,(new Date).getTime()+ +expires*1e3)}};LocalCache.prototype.getItem=function(key){var val=localStorage.getItem(cache_key_prefix+key),expires;if(val&&localStorage.getItem(cache_key_prefix+key+expires_key)){expires=+localStorage.getItem(cache_key_prefix+key+expires_key);if((expires-(new Date).getTime())/1e3<0){val=null;localStorage.removeItem(cache_key_prefix+key);localStorage.removeItem(cache_key_prefix+key+expires_key)}}if(val){return JSON.parse(val)}else{return null}};LocalCache.prototype.removeItem=function(key){localStorage.removeItem(cache_key_prefix+key);localStorage.removeItem(cache_key_prefix+key+expires_key)};LocalCache.prototype.clear=function(){setTimeout(function(){var re=/^cached\-/,p;for(p in localStorage){if(re.test(p)){localStorage.removeItem(p)}}},0)};return new LocalCache}();